  `event_website` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `event_thumbnail_photo` text COLLATE utf8mb4_unicode_ci,
  `event_banner_photo` text COLLATE utf8mb4_unicode_ci,
  `event_status` tinyint(1) DEFAULT NULL,
  `event_security_option` tinyint(1) DEFAULT NULL,
  `event_has_sub_event` tinyint(1) DEFAULT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `event_is_active` tinyint(1) NOT NULL DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `event_description` text COLLATE utf8mb4_unicode_ci,
  PRIMARY KEY (`id`),
  KEY `events_eventtype_id_foreign` (`eventtype_id`),
  KEY `events_user_id_foreign` (`user_id`),
  CONSTRAINT `events_eventtype_id_foreign` FOREIGN KEY (`eventtype_id`) REFERENCES `eventtypes` (`id`) ON DELETE CASCADE,
  CONSTRAINT `events_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
